/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `episodes` (
  `id` int NOT NULL,
  `seasonNum` int NOT NULL,
  `episodeNum` int NOT NULL,
  `episodeTitle` varchar(64) NOT NULL,
  `episodeLink` varchar(64) NOT NULL,
  `episodeAirDate` date NOT NULL,
  `episodeDescription` varchar(256) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `scene_to_episode` (`seasonNum`,`episodeNum`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
